import ThisWeekWage from "./ThisWeekWage";
import MyBalance from "./MyBalance";
import { useState } from "react";

function TopComp() {
  const [show, setShow] = useState(1);

  return (
    <div className="bg-terracotta-500 h-20 w-1/4 mb-6 rounded-lg flex flex-row items-center justify-between">
      {!show ? <MyBalance /> : null}
      {show ? <ThisWeekWage /> : null}
      <div className="h-full w-1/4 flex flex-row items-center justify-center">
        <div className=" flex flex-row items-center justify-center">
          <div className="w-9 h-9 rounded-full border-2 border-bridal-heath-500 relative  left-2"></div>
          <div className="w-9 h-9 rounded-full border-2 border-sambuca-500 bg-sambuca-500 right-2 abs"></div>
        </div>
      </div>
    </div>
  );
}

export default TopComp;
